import React from 'react';
import { Link } from 'react-router-dom';

function RightFixed() {
  return (
    <div className="right-container">
      <div className="right-text">
        <h4>Designed and developed by</h4>
      </div>
      <link to="/AboutMore">Noah Jung</link>
    </div>
  );
}

export default RightFixed;
